import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        posts: []
     }

     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/posts')
         .then(response => {
             console.log(response)
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 
        const {posts} = this.state
        return ( 
            <div>
               {
                   posts.map(data => 
                       <div>
                           {data.title}
                       </div>
                   )
               }
            </div>
         );
    }
}

export default Main;
